                    <a className='bg-sky-500 hover:bg-sky-700 text-white ' href='/login'><b>Iniciar sesion</b></a>
                    <a className='bg-sky-500 hover:bg-sky-700 text-white ' href='/register'><b>Regisrarse</b></a>




                </ul>

            </div>
        </div>

    )
}


export default Header;
